":"","dtend":"1431909000","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"","geolon":"0","geolat":"0","location":"Osceola Heritage Park","priority":"0","status":"","summary":"Bahia Shrine Circus","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-05-13 11:59:19","multiday":"1","hits":"68","noendtime":"0"},{"evdet_id":"123","rawdata":"","dtstart":"1432562400","dtstartraw":"","duration":"0","durationraw":"","dtend":"1432612799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<div>Below is the information for the Sanford Memorial Day Parade. I will send out our line up position as soon as I have it.<\/div>\r\n<div>Paul Pierce<\/div>\r\n<div>\r\n<div>\r\n<div>\u00a0<\/div>\r\n<div>Mayor Triplett and the Seminole County Area Veterans Advisory Council (S.C.A.V.A.C.) invite you to join us in Sanford on Monday, May 25<sup>th<\/sup>\u00a0on\u00a0<a href=\"https:\/\/www.youtube.com\/watch?v=ruzBfc69FkY\" target=\"_blank\">Memorial Day<\/a>\u00a0to Salute our Military and remember our Fallen Heroes from the American Revolution through Iraq and Afghanistan.\u00a0<\/div>\r\n<\/div>\r\n<div>\r\n<p>The City of Sanford\u2019s Memorial Day activities include:<\/p>\r\n<ul>\r\n<li>At\u00a0<span data-term=\"goog_1656260252\"><span>9 AM<\/span><\/span>, entertainment with our stilt walkers, clowns and music begins along the parade route.\u00a0<\/li>\r\n<\/ul>\r\n<ul>\r\n<li>At\u00a0<span data-term=\"goog_1656260253\"><span>10 AM<\/span><\/span>, the largest Memorial Day Parade in the southeast begins on 1<sup>st<\/sup>\u00a0Street at Sanford Avenue, continues westward to Park Avenue, and then north to Veterans Memorial Park on Seminole Boulevard.\u00a0 The parade has about 70 parade participants, over 6,000 parade spectators and takes an hour to travel its course. It winds through 6 blocks of Sanford\u2019s historic downtown and ends at Veterans Memorial Park, overlooking the Monroe Harbour Marina on the St. Johns River.\u00a0<\/li>\r\n<\/ul>\r\n<ul>\r\n<li>The Remembrance Ceremony begins immediately following the Parade, at approximately\u00a0<span data-term=\"goog_1656260254\"><span>11 AM<\/span><\/span>, to honor the sacrifices that so many devoted men and women made to keep and to protect our freedom.\u00a0 It is led by members of S.C.A.V.A.C. and supported by the Seminole County Sheriff\u2019s Office, Sanford\u2019s Police Department and Sanford\u2019s Fire Department.\u00a0 The Memorial Day Address will be given be Seminole County Sheriff\u2019s Chief Deputy Dennis Lemma, a U.S. Marine veteran.\u00a0\u00a0 Mayor Triplett will deliver the City of Sanford\u2019s Proclamation; Seminole County Chairman Carey will present the Memorial Day Resolution; the Police Department and the Sheriff\u2019s Office will present a dual 21-gun Salute; and Lake Mary High School Band student\u2019s will provide a presentation of Echo Taps;\u00a0 and the Sheriff\u2019s Office will provide a helicopter fly-over.<\/li>\r\n<\/ul>\r\n<p>At\u00a0<span data-term=\"goog_1656260255\"><span>2 PM<\/span><\/span>, you are also invited to the Seminole County\u00a0<a href=\"http:\/\/www.seminolecountyfl.gov\/departments-services\/other-agencies-organizations\/seminole-heroes-memorial.stml\" target=\"_blank\">Heroes Memorial<\/a>\u00a0Ribbon Cutting Ceremony.\u00a0 The Heroes Memorial is a new memorial site in Sanford to honor those who have made the ultimate sacrifice in service to Seminole County and our country. It is located in the grassy mall between the Seminole County Justice Building and State Road 17\/92 at 101 Bush Boulevard in Sanford.\u00a0<\/p>\r\n<p>We hope you join us in Sanford on Memorial Day as our community recognizes and honors those who served their Country with their last full measure of valor, courage, and distinction while supporting those service members, and their families, who understand the true meaning of sacrifice still today.\u00a0 We look forward to seeing you on Memorial Day!<\/p>\r\n<\/div>\r\n<\/div>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Sanford Memorial Day Parade","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-05-13 14:49:42","multiday":"1","hits":"65","noendtime":"1"},{"evdet_id":"124","rawdata":"","dtstart":"1436014800","dtstartraw":"","duration":"0","durationraw":"","dtend":"1436068799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><span style=\"font-family: Calibri; font-size: 16px; line-height: normal;\">we have a July 4th Parade in Mount Dora on\u00a0<\/span><span class=\"aBn\" style=\"border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #cccccc; position: relative; top: -2px; z-index: 0; font-family: Calibri; font-size: 16px; line-height: normal;\" data-term=\"goog_1656260257\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">7\/4\/15<\/span><\/span><span style=\"font-family: Calibri; font-size: 16px; line-height: normal;\">\u00a0Step off is\u00a0<\/span><span class=\"aBn\" style=\"border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #cccccc; position: relative; top: -2px; z-index: 0; font-family: Calibri; font-size: 16px; line-height: normal;\" data-term=\"goog_1656260258\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">10:00 am<\/span><\/span><span style=\"font-family: Calibri; font-size: 16px; line-height: normal;\">\u00a0line up is\u00a0<\/span><span class=\"aBn\" style=\"border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #cccccc; position: relative; top: -2px; z-index: 0; font-family: Calibri; font-size: 16px; line-height: normal;\" data-term=\"goog_1656260259\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">9:00 am.\u00a0<\/span><\/span><span style=\"font-family: Calibri; font-size: 16px