/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">This must be voted on by the Nobility per the Articles of Incorporation\/Bylaws:<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><em style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">\u00a7334.9 Sale of Temple Assets. Any temple, or any of its affiliates, contemplating\u00a0the sale, lease, exchange, mortgage, pledge or other disposition of all or substantially all\u00a0of its property and assets, may only do so upon such terms and conditions and for such\u00a0consideration as shall be first authorized by a vote of the temple at a Stated or special\u00a0meeting which sets forth in the notice of the meeting the specific nature of the business\u00a0to be transacted. The notice of the meeting must be sent to every member of the temple\u00a0at least 20 days prior to the meeting<\/em><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">I will also report on the proceedings from Imperial Session that will\u00a0be held in Houston over the 4th of July weekend. Your presence at\u00a0this meeting will be greatly appreciated.<\/span><\/p>\r\n<p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">There will be a dinner before the special Stated meeting<\/span><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">. Spaghetti, salad, bread, tea and water. Price I think is around $5. Please try to attend if you can.<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">Unity<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">Yours in Faith,<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">Ken Harrelson<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">Potentate 2015<\/span><\/p>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Special Called Meeting","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-07-22 08:02:46","multiday":"1","hits":"24","noendtime":"1"},{"evdet_id":"137","rawdata":"","dtstart":"1438813800","dtstartraw":"","duration":"0","durationraw":"","dtend":"1438833599","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p>I would like to meet\u00a0<span data-term=\"goog_704515683\"><span>August 5th at 6:30 pm<\/span><\/span>\u00a0in the Past Potentates Room for our initial \"kick-off\" meeting.\u00a0 I know this is short notice so if you are out of town or can't make it I completely understand.<\/p>\r\n<p>The agenda will be sent out prior to the meetin